package com.example.trackit;

import static org.junit.jupiter.api.Assertions.*;

import com.example.trackit.Events.Event;

import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;

class EventTest {
    Event event;

    @BeforeEach
    private void mockEvent() {
        String comment = "Hey what a great run!";
        String encodedImage = "";
        String date = "12/01/2021";
        Double latitude = 78.563;
        Double longitude = 364.98212;
        event = new Event(comment, encodedImage, date,longitude, latitude);

    }

    @Test
    void testEventComment() {
        // Getter testing for Event Comment
        String comment = "Hey what a great run!";
        assertEquals(comment, event.getComment());

        // Setter testing for Event Comment
        String comment2 = "Running is OP";
        event.setComment(comment2);
        assertEquals(comment2, event.getComment());
    }

    @Test
    void testEventDate(){
        // Getter testing for Event Date
        String expected = "12/01/2021";
        assertEquals(expected, event.getEventDate());

        // Setter testing for Event Date
        expected = "11/30/2022";
        assertEquals(expected, event.getEventDate());
    }

    @Test
    void testEventEncodedImage(){
        // Getter Testing for Event Image
        String expected = "";
        assertEquals(expected, event.getImage());

        // Setter Testing for Event Image
        expected = "";
        event.setImage(expected);
        assertEquals(expected, event.getImage());
    }

    @Test
    void testEventLatitude(){
        // Getter Testing for Event Latitude
        Double expected = 78.563;
        assertEquals(expected, event.getLatitude());

        // Setter Testing for Event Latitude
        expected = 77.323;
        event.setLatitude(expected);
        assertEquals(expected, event.getLatitude());
    }

    @Test
    void testEventLongitude(){
        // Getter Testing for Event Latitude
        Double expected = 364.98212;
        assertEquals(expected, event.getLongitude());

        // Setter Testing for Event Latitude
        expected = 578.23242;
        event.setLongitude(expected);
        assertEquals(expected, event.getLongitude());
    }
    
}